import React from "react";
import "./TFGPoke.css";

const TFGPoke = () => {
  return (
    <div className="pt-0 px-4 pb-10">
      {/* Navbar */}
      <nav className="hidden md:flex bg-black text-white p-4 sticky top-0 z-10 items-center">
        <div className="flex-shrink-0">
          <a href="/" className="navbar-links text-xl text-pink-400 font-semibold hover:text-white">
            Regresar
          </a>
        </div>
        <ul className="flex gap-6 justify-center flex-grow navbar-links text-xl">
          <li><a href="#inicioApp">Inicio</a></li>
          <li><a href="#administracion">Admin</a></li>
          <li><a href="#registro">Registro</a></li>
          <li><a href="#personaje">Personaje</a></li>
          <li><a href="#inicioaventura">Aventura</a></li>
          <li><a href="#mapa">Mapa</a></li>
          <li><a href="#acciones">Acciones</a></li>
        </ul>
      </nav>

      <header className="mb-12 text-center">
        <h1 className="text-4xl font-bold section-title">Pantallas del TFG Pokémon</h1>
        <p className="text-gray-400 mt-2">Resumen visual del proyecto de fin de grado</p>
      </header>

      <main className="space-y-16 max-w-6xl mx-auto">
        {[
          {
            id: "inicioApp",
            title: "Pantalla de inicio",
            images: [
              "pantallaInicioApp.webp"
            ],
          },
          {
            id: "administracion",
            title: "Panel de administración",
            images: [
              "adminPokemon.webp",
              "adminAtaques.webp",
              "adminTipos.webp",
              "adminEntrenadores.webp",
            ],
          },
          {
            id: "registro",
            title: "Registro e inicio",
            images: [
              "registro1.webp",
              "registro2.webp",
              "inicioSesion.webp",
            ],
          },
          {
            id: "personaje",
            title: "Selección de personaje",
            images: [
              "elegirGenero.webp",
              "ponerNombre.webp",
            ],
          },
          {
            id: "inicioaventura",
            title: "Inicio de la aventura",
            images: [
              "elegirInicial.webp",
              "comienzoHistoria.webp",
            ],
          },
          {
            id: "mapa",
            title: "Exploración del mapa",
            images: [
              "mapa.webp",
              "casa1.webp",
              "casa2.webp",
              "casa3.webp",
            ],
          },
        ].map(({ id, title, images }) => (
          <section key={id} id={id}>
            <h2 className="text-2xl font-semibold section-title text-center mb-6">{title}</h2>
            <div className="image-row">
              {images.map((img, idx) => (
                <img
                  key={idx}
                  src={`/static/img/imgTfgPoke/${img}`}
                  alt={`${title} ${idx + 1}`}
                  className="screenshot"
                />
              ))}
            </div>
          </section>
        ))}

        {/* Acciones */}
        <section id="acciones" className="text-center mt-16 space-y-6">
          <h3 className="text-2xl font-semibold section-title">Acciones</h3>
          <div className="flex justify-center gap-8 mt-4">
            <a
              href="https://github.com/alejandrosamalea/TFG-Poke"
              target="_blank"
              rel="noopener noreferrer"
              className="action-link"
            >
              <i className="devicon-github-original text-3xl"></i>
              <span>Ver en GitHub</span>
            </a>
          </div>
        </section>
      </main>
    </div>
  );
};

export default TFGPoke;
